import React,{Component} from "react";
import {NavLink} from "react-router-dom";

export default class MyNavLink extends Component {
  render() {
    console.log(this.props.children)  //这个是接受标签体内容。
    /*标签体内容可以通过children属性收到*/
    return (
      <NavLink activeClassName="testNavLink" className="list-group-item" {...this.props}/>
    );
  }
}
